        <div>
            <header>
                <h1>Biblioteca Digital</h1>
            </header>
            <main>
                <LivroList />
            </main>
            <footer>
                <p>&copy; 2024 Biblioteca Digital</p>
            </footer>
        </div>
    );
};

export default App;
